import React from 'react';
import { createRoot } from 'reacr-dom/client';
import App from './App';

ReactDOM.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>,
    document.getElementById('root')
);

const container = document.getElementById('root');
const root = createRoot(container);
root.render(
    <App />
);
